import React from "react";
import "antd/dist/antd.css";
import "./index.css";
import { Tag, Avatar, Tabs, Row, Col, Card } from "antd";
import profilePic from "./img/profile.jpg";
import pic1 from '../../assets/serge.jpeg';
import pic2 from '../../assets/serge.jpeg';
import { SettingOutlined, EditOutlined, EllipsisOutlined } from '@ant-design/icons';
// import map from "./img/mapplaceholder.jpg";

const { Meta } = Card;
const { TabPane } = Tabs;
var mapStyle = {
  height: "200px",
  width: "100%",
  backgroundColor: "black"
};
var cardStyle = {
  width: "100%",
  marginBottom: "20px"
};

var avatarStyle = {
  marginTop: "-50px",
  marginBottom: "20px",
  width: "100px",
  height: "100px"
};

function callback(key) {
  console.log(key);
}

const Profile = () => {
    return (
    <div>
        <Row type="flex" justify="center" align="top">
            <div style={mapStyle}>map</div>
        </Row>
        <Row type="flex" justify="center" align="top">
        <Avatar style={avatarStyle} src={profilePic} />
        </Row>
        <Row type="flex" justify="center">
        <h1>Andrew</h1>
        </Row>
        <Row type="flex" justify="center" style={{ marginBottom: "30px" }}>
        <Tag color="cyan">Hagerty Pro</Tag>
        <Tag color="blue">Loves road trips</Tag>
        </Row>
        <Row type="flex" justify="center" align="top">
        <Tabs
            tabBarGutter="0"
            size="small"
            defaultActiveKey="1"
            onChange={callback}
        >
            <TabPane tab="Stories" key="1">
            <Card
                style={cardStyle}
                cover={<img alt="example" src={pic1} />}
                actions={[
                    <SettingOutlined />,
                    <EditOutlined />,
                    <EllipsisOutlined />,
                    // <Icon type="setting" />,
                    // <Icon type="edit" />,
                // <Icon type="ellipsis" />
                ]}
            >
                <Meta
                avatar={<Avatar src={profilePic} />}
                title="Florida"
                description="Palm tree cruise"
                />
            </Card>
            <Card
                style={cardStyle}
                cover={<img alt="example" src={pic2} />}
                actions={[
                    <SettingOutlined />,
                    <EditOutlined />,
                    <EllipsisOutlined />,
                // <Icon type="setting" />,
                // <Icon type="edit" />,
                // <Icon type="ellipsis" />
                ]}
            >
                <Meta
                avatar={<Avatar src={profilePic} />}
                title="All pages on deck"
                description="Page family trip"
                />
            </Card>
            </TabPane>
            <TabPane tab="Past trips" key="2">
            Content of Tab Pane 2
            </TabPane>
            <TabPane tab="Upcoming" key="3">
            Content of Tab Pane 3
            </TabPane>
        </Tabs>
        </Row>
    </div>
)}

export default Profile;
